syntax = "proto3";

package navzy;

import "google/protobuf/timestamp.proto";

option go_package = "github.com/fatehan-navzy/strc/packets";

message Result {
  enum PacketType {
    FAILED = 0;
    AUTHORIZE = 1;
    DATA = 2;
    HEARTBEAT = 3;
    ANSWER = 4;
    CUSTOM = 5;
  }
  uint64 imei = 1 [json_name = "imei"];
  repeated Data data = 2 [json_name = "data"]; 
  bytes response = 3 [json_name = "response"];
  bytes answer = 4 [json_name = "answer"];
  bytes payload = 5 [json_name = "payload"]; 
}

message Task {
  uint64 imei = 1;
  Packet packet = 2;
  Client client = 3;
}

message Client {
  string ip = 1;
  uint32 port = 2;
  string server_ip = 3;
  uint32 server_port = 4;
}

message Data {
  string device_id = 1 [json_name = "device_id"];
  google.protobuf.Timestamp received = 2 [json_name = "received"];
  Packet packet = 3 [json_name = "packet"];
}

message Packet {
  uint64 device_id = 1 [json_name = "device_id"];
  google.protobuf.Timestamp datetime = 2 [json_name = "datetime"];
  float latitude = 3 [json_name = "latitude"];
  float longitude = 4 [json_name = "longitude"];
  uint32 altitude = 5 [json_name = "altitude"];
  uint32 angle = 6 [json_name = "angle"];
  uint32 speed = 7 [json_name = "speed"];
  optional uint32 satellite = 8 [json_name = "satellite"];
  optional bool ignition = 9 [json_name = "ignition"];
  optional uint64 mileage = 10 [json_name = "mileage"];
  repeated Alert alerts = 11 [json_name = "alerts"];
  repeated Io ios = 12 [json_name = "ios"];
}

message Io {
  enum IoUnit {
    Number = 0;
    Celsius = 1;
    Fahrenheit = 2;
    Kelvin = 3;
    RH = 4;
    Hectopascals = 5;
    Millibars = 6;
    InchesOfMercury = 7;
    Pascals = 8;
    Meters = 9;
    Kilometers = 10;
    Miles = 11;
    Feet = 12;
    NauticalMiles = 13;
  }

  enum IoKind {
    Normal = 0;
    Temperature = 1;
    Humidity = 2;
    Pressure = 3;
  }

  IoProperty io = 1;

  oneof value {
    sint32  int32_value = 2;
    uint32  uint32_value = 3;
    sint64  int64_value = 4;
    uint64  uint64_value = 5;
    float   float_value = 6;
    double  double_value = 7;
    string  string_value = 8;
    bool    bool_value = 9;
    bytes   raw_value = 10;
  }
}

